create database BancoDeDadosHBSIS2

GO

use BancoDeDadosHBSIS2

GO

CREATE TABLE [dbo].[Tipos] (
    [Id]     INT        IDENTITY (1, 1) NOT NULL,
    [Codigo] INT        NULL,
    [Nome]   NVARCHAR (10) NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC),
    CONSTRAINT [AK_Tipos_Codigo] UNIQUE NONCLUSTERED ([Codigo] ASC)
);

GO

CREATE TABLE [dbo].[ModelosVeiculos] (
    [Id]          INT        IDENTITY (1, 1) NOT NULL,
    [Modelo]      NVARCHAR (50) NULL,
    [MarcaCodigo] INT        NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC)
);

GO

CREATE TABLE [dbo].[Marcas] (
    [Id]         INT           IDENTITY (1, 1) NOT NULL,
    [Codigo]     INT           NULL,
    [Nome]       NVARCHAR (20) NULL,
    [TipoCodigo] INT           NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC),
    CONSTRAINT [AK_Marcas_Codigo] UNIQUE NONCLUSTERED ([Codigo] ASC),
    CONSTRAINT [FK_Marcas_ToTipos] FOREIGN KEY ([TipoCodigo]) REFERENCES [dbo].[Tipos] ([Codigo])
);

GO


SET IDENTITY_INSERT [dbo].[Tipos] ON
SET IDENTITY_INSERT [dbo].[Tipos] OFF

GO

SET IDENTITY_INSERT [dbo].[Marcas] ON
SET IDENTITY_INSERT [dbo].[Marcas] OFF

GO

SET IDENTITY_INSERT [dbo].[ModelosVeiculos] ON
SET IDENTITY_INSERT [dbo].[ModelosVeiculos] OFF

